INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11020, 1, "ht_ulht_liITALISSIMA Foods is proud to offer wide range of products in Fagioli (“Beans native to Italy”) category and beyond.d_ht_liht_liChick peas are all-round alternative as an ingredient and deserves to be in the list ingredients for most of the food recipes.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11021, 1, "ht_ulht_liFava beans is of the recommended alternatives for meat as per Canada’s Food Guide.d_ht_liht_liFava beans have less calories per mass as its’ counterparts like black beans, chick peas and so on. However, has almost same amount of fiber, protein and vital vitamins alongside with iron as other pulses mentioned earlier.d_ht_liht_liIt helps maintain healthy heart and, in some cases, prevent against certain types of cancer.d_ht_liht_liFava beans by Clic are proudly made in Canada and one of the popular products in beans category.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11022, 1, "ht_ulht_liITALISSIMA Foods is proud to offer wide range of products in Fagioli (“Beans native to Italy”) category and beyond.d_ht_liht_liCannelini Beans come straight from Italy with bunch of healthy benefits as other pulses.d_ht_liht_liThese canned legumes will take minimal work to prepare and much more benefit to deliver.d_ht_liht_liWhen cannellini beans are cooked they become fluffy and taste slightly nutty with mild flavor.d_ht_liht_liITALISSIMA - Cannellini Beans just need to be drained and rinsed - then they're ready to use.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11023, 1, "ht_ulht_liAlthough Chef’s Choice – Chick Peas were made in Canada, chick peas are originally from Mediterranean and Middle East region.d_ht_liht_liChick peas come with extremely large number of health benefits and they are also tasty. Thus, making it one of the favorite choices for people who want to get most out of their food.d_ht_liht_liChick peas are high in protein, fiber and contain other essential vitamins and minerals.d_ht_liht_liThese legumes are good for maintaining blood pressure, bone health, heart health, digestion and regularity and many more.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11024, 1, "ht_ulht_liRed Kidney beans are great source of essential nutrients like protein, fiber, vitamins and minerals.d_ht_liht_liIt helps maintain blood pressure, also a good choice for individuals with diabetes.d_ht_liht_liEnjoy one of the healthiest pulses in the world.d_ht_liht_liChef’s choice – Red Kidney beans just need to be drained and rinsed - then they're ready to use.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11025, 1, "ht_ulht_liAlso known as Italian flat bean and Italian Pole Bean, Green Romano beans are awesome food to be consumed.d_ht_liht_liChef's choice - Romano Beans proudly made in Canada and are recommended for soups, cold bean salads, stews and pastas.d_ht_liht_liIt just needs to be drained and rinsed - then they're ready to use.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11026, 1, "ht_ulht_liLima beans might also be called “butter beans” for their soft and buttery texture and delicious taste that is good side for different dishes.d_ht_liht_liThese legumes are exceptional source of fiber which controls blood sugar levels, rich with protein which comes with almost no fat.d_ht_liht_liMoreover, Lima beans lower the risk of heart attack delivers high iron to boost energy levels.d_ht_liht_liCanned Lima beans are available all year round and here to be enjoyed.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11027, 1, "ht_ulht_liAdding white beans to your diet comes with various health benefits.d_ht_liht_liWhite kidney beans rich in protein, fiber and other essential vitamins and minerals.d_ht_liht_liTherefore, it has cancer-fighting properties, helps heart stay healthy, detoxifies sulfites and many more.d_ht_liht_liChef’s choice – White Kidney beans is proudly made in Canada and ready to be used, just need to be drained and rinsed.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11028, 1, "ht_ulht_liClic offers wide variety of bean products and chick peas are one of them.d_ht_liht_liChick peas are all-round alternative as an ingredient and deserves to be in the list ingredients for most of the food recipes.d_ht_liht_liCarefully selected and convenietly packed chick peas bu Clic are ready to be served, just need to drain and rinse. Enjoy!d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11029, 1, "ht_ulht_liIn need of healthy protein boost for your next meal? What can be better that a mixture of beans with all essential nutrients in one place.d_ht_liht_liDelicious mixture of Cannelini Beans, Red Kidney Beans, Butter Beans, Chick Peas, Romano Beans offered by Clic canned and ready to be consumed either as a snack or one of the ingredients for main meal.d_ht_liht_liCanned beans are simple and easy solution for quick cold bean salads.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11030, 1, "ht_ulht_liBlack beans or Turtle beans often make headlines of medical news due to their health benefits.d_ht_liht_liLike other legumes black beans contain significant amount of protein, fiber and several other key vitamins that are known to be good for humans.d_ht_liht_liThere are numerous articles on health benefits of black beans as one of the popular foods.d_ht_liht_liBlack beans help us maintain healthy bones and it protects heart.d_ht_liht_liLong story short it is very good candidate to be added to your cart.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11032, 1, "ht_ulht_liBlack-eyed beans also known as black-eyed peas are one of the most nourishing food products in legume category.d_ht_liht_liName is self-evident as these legumes have one bold black dot in the center that resembles eye shape.d_ht_liht_liBlack-eyed beans contain Vitamin A, B as well as it helps with digestion system due to high fiber content.d_ht_liht_liMoreover, these legumes are great source of protein alongside with other important nutrients and vitamins.d_ht_liht_liClic - Black Eye Beans are carefully selected and conveniently canned for us to drain, rinse and enjoy it.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11034, 1, "ht_ulht_liRisotto is an iconic rice dish that stems deep from Italian traditional cuisine.d_ht_liht_liCarnaroli rice is one of the well-known rice kinds in Italy and around the world. It has large grains that adds ability to easily absorb flavors and mix in.d_ht_liht_liCarnaroli has property to maintain its’ shape while cooking which makes it extremely versatile rice type and important for special event dishes.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11035, 1, "ht_ulht_liCarnaroli rice is one of the well-known rice kinds in Italy and around the world.d_ht_liht_liIt has large grains that adds ability to easily absorb flavors and mix in.d_ht_liht_liCarnaroli has property to maintain its shape while cooking which makes it extremely versatile rice type and important for special event dishes.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11036, 1, "ht_ulht_liItalissima Arborio Riso – is a good fit for risotto dishes that can also be made with additional ingredients like porcini mushrooms, saffron and meats.d_ht_liht_liArborio rice due to its' short-grain texture becomes creamy, soft and chewy once it is cooked.d_ht_liht_liOn top of that it is usually cooked in butter or olive oil to coat layer of fat around grains which will add more to the creaminess of Arborio rice grains.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11037, 1, "ht_ulht_liArborio Rice (“Riso”) – is extremely popular ingredient for risotto dishes which usually will also contain additional ingredients like porcini mushrooms, saffron and meats.d_ht_liht_liThanks to their short-grain texture Arborio rice becomes creamy, chewy and delicious once it is cooked.d_ht_liht_liOn top of that it is usually cooked in butter or olive oil to coat layer of fat around grains which will add more to the creaminess of Arborio rice grains.d_ht_liht_liNo matter what grains risotto dish is made from, it is all-around dish worth including in your cooking list.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11039, 1, "ht_ulht_liAnna's Country Kitchen - Whole Wheat Organic Arborio Rice is brown rice that has all its nutrients enclosed.d_ht_liht_liAlthough cooking process quite like making risotto dish with regular (white) rice, results are slightly different.d_ht_liht_liIn the case of Brown rice (“Whole wheat”) it comes out with extra fiber and nutty flavor.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11040, 1, "ht_ulht_liArborio Rice by TERRA DEL RISO – is a good fit for risotto dishes that can also be made with additional ingredients like porcini mushrooms, saffron and meats.d_ht_liht_liArborio rice due to its' short-grain texture becomes creamy, soft and chewy once it is cooked.d_ht_liht_liOn top of that it is usually cooked in butter or olive oil to coat layer of fat around grains which will add more to the creaminess of Arborio rice grains.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11041, 1, "ht_ulht_liArborio rice - name comes from town of Arborio in Itally which is located in major growing region of a country.d_ht_liht_liArborio rice due to its' short-grain texture becomes creamy, soft and chewy once it is cooked.d_ht_liht_liOn top of that it is usually cooked in butter or olive oil to coat layer of fat around grains which will add more to the creaminess of Arborio rice grains.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11042, 1, "ht_ulht_liCarnaroli rice is one of the common rice types used in Italian cuisine.d_ht_liht_liCarnaroli rice has larger grain size, higher content of starch and stiffer texture in comparison to Arborio Rice.d_ht_liht_liCarnaroli has property to maintain its shape while cooking which makes it extremely versatile dish worth including in your cooking list.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11043, 1, "ht_ulht_liCous Cous is delicious dish made from steamed durum wheat semolina balls with stew poured upon it.d_ht_liht_liTherefore, DIVELLA - CousCous is not technically a grain but more like tiny spheres of pasta from durum wheat.d_ht_liht_liCouscous originated from North African (“Barbary coast”) region, now enjoyed all around the world.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11044, 1, "ht_ulht_liArborio rice - name comes from town of Arborio in Itally which is located in major growing region of a country.d_ht_liht_liArborio rice due to its' short-grain texture becomes creamy, soft and chewy once it is cooked.d_ht_liht_liOn top of that it is usually cooked in butter or olive oil to coat layer of fat around grains which will add more to the creaminess of Arborio rice grains.d_ht_liht_liIt would be great if salt added gradually and in moderation throughout cooking process when making Risotto as the rice absorbs it slowly and uniformly.d_ht_liht_li*Vacuum-packing prevents the rice from changing and preserves the color, flavor and nutritional values of the grain.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11045, 1, "ht_ulht_liAurora – Italian style rice can be used for any occasion where rice is needed.d_ht_liht_liRisotto (“Rice dish”) is a staple in Northern Italian cuisine which often cooks with other ingredients like mushroom, meat, saffron and many more.d_ht_liht_liItalian style rice is more rounded and have soft, creamy texture to it.d_ht_liht_liFlavor gets enhanced even more when cooked with olive oil or butter.d_ht_liht_liSome recipes include white or red wine add to risotto during preparation which will overall boost taste of Italian style risotto dish.d_ht_lid_ht_ul " );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11046, 1, "ht_ulht_liCarnaroli rice is one of the common rice types used in Italian cuisine.d_ht_liht_liCarnaroli rice has larger grain size, higher content of starch and stiffer texture in comparison to Arborio Rice.d_ht_liht_liCarnaroli has property to maintain its shape while cooking which makes it extremely versatile dish worth including in your cooking list.d_ht_lid_ht_ul" );
