INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11122, 1, "ht_ulht_liDill is ubiquitous herb that has been used as food and medicine for very long time.d_ht_liht_liIt was also used in cosmetics and perfume production in ancient Egypt.d_ht_liht_liDill is also commonly used as an appetizer and believed to help peristatic motion of the intestine.d_ht_liht_liWhat a wonder plant?!d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11123, 1, "ht_ulht_liFennel seeds are also known as ‘saunf’ in India and yet India is the major exporter of this herb in the world.d_ht_liht_liFennel seeds have high concentration of minerals and vitamins such as copper, potassium, calcium, zinc, manganese, vitamin C, iron, selenium and magnesium.d_ht_liht_liThose nutrients play vital role in stabilizing blood pressure, reduce water retention in our bodies, help purify blood, improve eyesight and many more.d_ht_lid_ht_ul" );
