INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11193, 1, "The unique and distinctive natural flavor of Texas mesquite wood smoke adds just the right hint of a ranch cookout to our authentic Texas Bar-B-Q Sauce. So, if you can't cook out on a ranch, we'll bring the ranch to you." );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11194, 1, "ht_ulht_liOven and outdoor grillin'  sauce is prepared as only a fourth generation chicken cooker can do.d_ht_liht_liNot only is Chik'n Lik'n sauce especially good in preparing chicken, it is also outstanding on all white meat dishes-pork, fish, shrimp and wild game.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11197, 1, "ht_ulht_liThis award-winning sauce is for those who like a little extra Texas excitement in their barbecue.d_ht_liht_liWith more peppers and spices than your average sauce and the right balance of natural hickory smoke flavor, Killer is not enough to please but not too hot to enjoy.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11198, 1, "ht_ulht_liNot unlike the time of day when the sun and the moon share the sky.d_ht_liht_liSalsa del Rio is perched precariously between relentless heat and refreshing cool.d_ht_liht_liAn intriguing, enigmatic balance that flows together as gracefully as its name.d_ht_liht_liAllowing even the mildest of heart to flirt with fire, without the threat of getting burned.d_ht_lid_ht_ul" );
INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11199, 1, "ht_ulht_liEscape to a sun-dappled plantation and feast your eyes on a pairing of mangoes and peaches, peppers and spices…bursting with juicy flavor and ripe for the dipping. Truck a jar in your basket and sample the fruits of your desire. d_ht_liht_liAll-natural ingredients.d_ht_lid_ht_ul" );
