INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11246, 1, "ht_ulht_liThe story of Carr’s began during the British Industrial revolution when Jonathan Dogson Carr set up a small bakery in the city of Carlisle in 1831.d_ht_liht_liCarr’s Table Water in their original form first appeared in the late 19th century as a refinement of the ship’s biscuit.d_ht_liht_liWater instead of fat was used to blend the dry ingredients in order to keep the biscuits fresh on long voyages.d_ht_liht_liCarr’s Table water are still baked today using traditional brick ovens, in the proud tradition established by Jonathan Dogson Carr.d_ht_lid_ht_ul" );
