INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11251, 1, "ht_ulht_liSince 1966 Pan Ducale has produced these Biscotti following a traditional family recipe.d_ht_liht_liFirst, they are baked in the shape of a French loaf. Then they are cut into thin slices and baked again, until they are golden brown and crunchy.d_ht_liht_liThese biscuits are produced using 100% Organic ingredients, ensuring that they are free from pesticides or artificial preservatives.d_ht_liht_liA delicious sweet snack. Ideal with a cappuccino or any other hot drink. Individually wrapped for freshness.d_ht_lid_ht_ul" );
