INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11254, 1, "ht_ulht_liKii Naturals Date & Lemon with Rolled Oat Flakes is the result of years spent meeting and forging relationships with local farmers from Europe, Asia, Africa, the Middle east and South America.d_ht_liht_liFrom this I’ve learned that the most authentic and flavorful fruits, nuts, seeds, grains and spices come from orchards and fields where they naturally grow.d_ht_liht_liMany of these farmers continue to provide Kii Naturals with the world’s finest ingredients, which are used every day to make our crisps.d_ht_lid_ht_ul" );
