INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11263, 1, "ht_ulht_liOur family created these delicious crunchy almond crisps for special occasions and get-togethers.d_ht_liht_liIt's a lighter version of grandma Dina's original secret family recipe. The crisps quickly became a highly requested snack item at the office, school events, on road trips and at parties.d_ht_liht_liBaked with simple ingredients found in most kitchens, these crisps contain no cholesterol, no dairy, no preservatives, no added fat and salt.d_ht_liht_liExtremely snackable and crunchy, almandina toastees are perfect on their own or with toppings.d_ht_liht_liExcellent when paired with cheeses, enjoy with coffee, superb in ice cream or yogurt and a great treat for children of all ages. Have a nice crunch!d_ht_lid_ht_ul" );
