INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11288, 1, "ht_ulht_liSuperior class olive oil obtained from olives using solely mechanical means.d_ht_liht_liFrom century old olive groves located in the heart of Sardegna in the Marmilla region, Santidu (in Sardinian “Feelings”) is an extra virgin olive oil produced from two typical Sardinian olive varietals: Tonda di Cagliari and Semidana. This area of rolling hills is blessed with a climate perfect for the olive tree constant sea breezes and southern exposure ensure a bountiful yearly harvest of healthy olives.d_ht_liht_liThe olives are entirely hand-picked (in the local dialect this process calles “spibidai”) and processed within 12 hours in a state of the art continuous-cycle mill.d_ht_liht_liWith a low acidity and a medium fruity and tomato nose. In the mouth, a superb and harmonious balance between bitter and spicy with a long, clean finish.d_ht_liht_liWe recommend that you enjoy SANTIDU on typical Sardian dishes such as Fregola Sarda dishes with clams and fish, artichoke salads and on green vegetables as well as a seasoning over crudo and lightly seared fish.d_ht_lid_ht_ul" );
