INSERT INTO `catalog_listings_descriptions` (listing_id, description_key, description) VALUES ( 11583, 1, "ht_ulht_liWe are proud to bring you a product made with Blue Corn and some of the finest Non-Hydrogenated Oils in the market.d_ht_liht_liThese chips are very thin and crispy with the delicious flavour that blue corn brings to your plate. That is the reason the Aztec Indians prayed and glorified goddess of the corn “Chicomecoatl” to thank her for providing such a delectable crop. Corn was so important to the Aztecs that she was also known as “the goddess of nourishment” and they depicted her carrying the Sun as a shield. Delicious! – The preparation f Nixtamal was a daily task for the housewife, and even now in old Mexico it still occupies upto six hours of woman’s day.d_ht_liht_liThe kernels were steeped in lime overnight to loosen the hull, then boiled and skinned, and finally ground to dough by crushing the kernels between a grooved stone roller and a Metate (Lava rock stone slab). The Nixatamal was usually made into tortillas. d_ht_liht_liTaste the blue corn chips and you will be transported to the Aztecs world and you too will pray to “Chicomecoatl” for more.d_ht_lid_ht_ul");
